  <script>
    // Select the SVG element
    const svg = d3.select("#titanic-svg");

    // Define grid parameters
    const gridSize = 20; // Adjust the grid square size
    const width = 800;  // Match SVG's width
    const height = 400; // Match SVG's height

    // Create a grid overlay
    for (let x = 0; x < width; x += gridSize) {
      for (let y = 0; y < height; y += gridSize) {
        svg.append("rect")
          .attr("x", x) // X-coordinate
          .attr("y", y) // Y-coordinate
          .attr("width", gridSize) // Width of each square
          .attr("height", gridSize) // Height of each square
          .attr("fill", "rgba(255, 0, 0, 0.2)") // Semi-transparent fill for testing
          .attr("stroke", "blue") // Blue stroke for visibility
          .attr("stroke-width", 1); // Line thickness
      }
    }

    // Example interactivity: Highlight grid squares on hover
    d3.selectAll("rect")
      .on("mouseover", function () {
        d3.select(this).style("fill", "lightblue"); // Highlight square
      })
      .on("mouseout", function () {
        d3.select(this).style("fill", "none"); // Reset square fill
      });

    console.log("Grid overlay successfully added to Titanic layout!");
  </script>
